import Page from "../layouts/Page";

const Index = () => (
    <Page>
        <section className="content">
            <h1>Orion Xiao</h1>
            <p>
                Hi, my name is Orion.\n<br />
                I'm currently studying Finance and Data Science at NYU, with a
                minor in Computer Science.
            </p>
        </section>
    </Page>
);

export default Index;
